The crust is easy, easy. Youâ€™ll find it on p. 124 #thevegetablebutcher cookbook. Iâ€™ve left out the fennel seeds but they would be great here as well. 

-Roll the dough out to roughly 14 inches. 

-Layer tomatoes over a mixture of ricotta (about 1 cup), parmesan, shredded part-skim mozzarella, and basil, about 1.5 inches from the edge of the dough. (To avoid a soggy pie, salt the tomatoes and let them drain on a kitchen towel or paper towels for up to 30 minutes, blot dry.) 

-Brush the tomatoes with garlic and olive oil. Fold the dough up and over the tomatoes. Brush the crust with egg wash. 

-Bake 375 for 50 to 55 minutes until the tomatoes are wilted and the crust is golden. Let cool at least 10 minutes. Serve warm or room temp topped with fresh basil and flaky sea salt.
